const initialState = {
    currentTemperature: -273.15
}

export default function weatherReducer(state = initialState, action) {
  console.log(action)
    switch (action.type) {
      case "SET_CURRENT_TEMPERATURE":
        return {
          ...state,
          currentTemperature: action.temperature
        };
      default:
        return state;
    }
  }
